pragma solidity ^0.8.0;

contract Consultation {
    address payable public consultant;
    uint public consultationFee;
    mapping(address => uint) public balances;
    
    event PaymentReceived(address indexed from, uint amount);
    event ConsultationStarted(address indexed consultant, address indexed client);
    event ConsultationEnded(address indexed consultant, address indexed client);

    constructor(uint _consultationFee) {
        consultant = payable(msg.sender);
        consultationFee = _consultationFee;
    }
    
    function startConsultation() public payable {
        require(msg.value >= consultationFee, "Insufficient payment.");
        emit PaymentReceived(msg.sender, msg.value);
        emit ConsultationStarted(consultant, msg.sender);
    }
    
    function endConsultation() public {
        require(msg.sender == consultant, "Only the consultant can end the consultation.");
        uint payoutAmount = address(this).balance;
        consultant.transfer(payoutAmount);
        emit ConsultationEnded(consultant, msg.sender);
    }
    
    function withdraw() public {
        uint amount = balances[msg.sender];
        require(amount > 0, "Insufficient balance.");
        balances[msg.sender] = 0;
        payable(msg.sender).transfer(amount);
    }
    
    receive() external payable {
        balances[msg.sender] += msg.value;
        emit PaymentReceived(msg.sender, msg.value);
    }
}
